import React from 'react'
import TextInput from './textinput'


const TextInputIndex = ({ id, label, onChange }) => {
    return (
        <>
            <TextInput id={id} label={label} onChange={onChange}></TextInput>
        </>
    )
}

export default TextInputIndex
